  let itinerary = []; // Array to store selected destinations

        function renderDestinations(destinationArray) {
            const destinationsList = document.getElementById('destinations-list');
            destinationsList.innerHTML = "";

            destinationArray.forEach((destination, index) => {
                const card = document.createElement('div');
                card.className = 'card';

                const img = document.createElement('img');
                img.src = destination.image || 'https://via.placeholder.com/300?text=No+Image';
                card.appendChild(img);

                const title = document.createElement('h2');
                title.textContent = destination.name;
                card.appendChild(title);

                const description = document.createElement('p');
                description.textContent = destination.details || 'Description not available';
                description.style.fontStyle = 'italic';
                card.appendChild(description);

                const viewButton = document.createElement('button');
                viewButton.textContent = 'View Details';
                viewButton.className = 'view-button';
                viewButton.style.marginRight = '10px';
                viewButton.onclick = () => toggleDetails(index);
                card.appendChild(viewButton);

                const addButton = document.createElement('button');
                addButton.textContent = 'Add to Itinerary';
                addButton.className = 'add-itinerary-button';
                addButton.onclick = () => addToItinerary(destination.name);
                card.appendChild(addButton);

                const details = document.createElement('div');
                details.className = 'details';
                details.id = `details-${index}`;

                details.innerHTML = `
                    <p><strong>Cost Estimate:</strong> ${destination.costEstimate}</p>
                    <p><strong>Duration:</strong> ${destination.duration}</p>
                    <p><strong>Flight Duration:</strong> ${destination.travelTime.duration}</p>
                `;

                card.appendChild(details);
                destinationsList.appendChild(card);
            });
        }

        function addToItinerary(destinationName) {
            if (!itinerary.includes(destinationName)) {
                itinerary.push(destinationName);
                alert(`${destinationName} has been added to your itinerary!`);
            } else {
                alert(`${destinationName} is already in your itinerary.`);
            }
        }

        function toggleDetails(index) {
            const details = document.getElementById(`details-${index}`);
            details.style.display = details.style.display === "block" ? "none" : "block";
        }

        function searchDestination() {
            const searchQuery = document.getElementById('search').value.toLowerCase();
            const filteredDestinations = destinations.filter(dest =>
                dest.name.toLowerCase().includes(searchQuery)
            );
            renderDestinations(filteredDestinations);
        }

        document.getElementById('searchButton').addEventListener('click', searchDestination);

        document.addEventListener('DOMContentLoaded', () => {
            document.getElementById('itineraryButton').onclick = () => alert(`Your Itinerary: ${itinerary.join(', ') || 'No destinations added!'}`);
            renderDestinations(destinations);

            document.addEventListener('DOMContentLoaded', () => {
                document.getElementById('itineraryButton').onclick = () => alert(`Your Itinerary: ${itinerary.join(', ') || 'No destinations added!'}`);
                renderDestinations(destinations);
            
                // Back button event listener
                document.addEventListener('DOMContentLoaded', () => {
                    document.getElementById('itineraryButton').onclick = () => alert(`Your Itinerary: ${itinerary.join(', ') || 'No destinations added!'}`);
                    renderDestinations(destinations);
                    
                    // Back button event listener
                    document.getElementById('backButton').addEventListener('click', () => {
                        window.location.href = 'index.html'; // Apne home page ka URL yaha specify karo
                    });
                });
                
            });
            
        });